def m1(matrix):
    costs = [[999999]*len(matrix[0]) for i in matrix]
    directs = [(1, 0), (-1,0), (0,-1),(0,1)]
    
    for i, row in enumerate(matrix):
        for j, val in enumerate(row):
            if matrix[i][j] == 0:
                costs[i][j] = 0
    
    not_done = True
    count = 0
    while not_done:
        not_done = False
        count += 1
        for i, row in enumerate(matrix):
            for j, val in enumerate(row):

                dists = [costs[i][j]]
                for d in directs:
                    r = i + d[0]
                    c = j + d[1]

                    if r >= 0 and r < len(matrix) and c >= 0 and c < len(matrix[0]):
                        dists.append(1+costs[r][c])
                d = min(dists)
                if d != costs[i][j]:
                    not_done = True
                costs[i][j] = d
    
    return costs

def m2(matrix):

    def verify(r, c, matrix):
        if r >= 0 and r < len(matrix) and c >= 0 and c < len(matrix[0]):
            return True
        return False

    costs = [[99999999]*len(matrix[0]) for i in matrix]
    queue = []
    for i, row in enumerate(matrix):
        for j, val in enumerate(row):
            if matrix[i][j] == 0:
                queue.append((i,j, 0))
                costs[i][j] = 0
    
    directs = [(1, 0), (-1,0), (0,-1),(0,1)]
    useful = 0
    while len(queue) > useful:
        cr, cc, cv = queue[useful]
        #queue = queue[1:]
        useful += 1
        #print(useful)
        #print(len(queue))

        #costs[cr][cc] = min(cv, costs[cr][cc])

        for d in directs:
            r = cr + d[0]
            c = cc + d[1]

            if verify(r, c, matrix) and costs[r][c] == 99999999:
                costs[r][c] = cv + 1
                queue.append((r, c, cv + 1))

        #print(queue)

    return costs

def updateMatrix(matrix):
    """
    :type matrix: List[List[int]]
    :rtype: List[List[int]]
    """
    import time

    start = time.time()
    a = m1(matrix)
    end = time.time()
    print(end - start)

    start = time.time()
    b = m2(matrix)
    end = time.time()
    print(end - start)

    print(a == b)


